import React from 'react'

export default function Dropdown2(props) {
  return (
    <select
      id={props.name}
      name={props.name}
      class="selectpicker"
      data-live-search="true"
    >
      <option>Mustard</option>
      <option>Ketchup</option>
      <option>Relish</option>
    </select>
  );
}
